export default function About() {
  return (
    <div>
      <h1>About Milind Kopikar</h1>
      <p>
        I am a teacher, entrepreneur, and technology executive passionate about building impactful software.
      </p>
      <p>
        This site showcases my SaaS projects and insights on AI and entrepreneurship.
      </p>
    </div>
  );
}
